<script>

let de=new DE405();

function test(data){
	//Horizon's codes for bodies
	//10 Sun
	//3 EMB
	//301 Moon

	if(data[0]==99){return;}
	let planet=(data[0]-99)/100-1;
	const jd=data[1];

	let d;
	if(planet==2){
		let emb=de.getAllPropertiesForSeries(2,jd);
		let moon=de.getAllPropertiesForSeries(9,jd);
		d=DE405.getEarthPositionFromEMB(emb,moon);

	} else {
		d=de.getAllPropertiesForSeries(planet,jd);
	}
	const e1=Math.abs(d[0]-data[3]);
	const e2=Math.abs(d[1]-data[4]);
	const e3=Math.abs(d[2]-data[5]);
	const e4=Math.abs(d[3]-data[6]);
	const e5=Math.abs(d[4]-data[7]);
	const e6=Math.abs(d[5]-data[8]);

	const r=Math.sqrt(e1*e1+e2*e2+e3*e3);
	const rr=Math.sqrt(e4*e4+e5*e5+e6*e6);

	console.log(`${planet} ${r} ${rr}`);
	//console.log(`${planet} ${r} ${e1} ${e2} ${e3} ${e4} ${e5} ${e6}`);
}
